import React from "react";
import styled from "styled-components";
const HomeStyled = styled.div`
  display: flex;
  align-items: center;
  justify-content: center;
  height: 100vh;
`;
const Home = () => {
  return (
    <HomeStyled>
      <h1>Home</h1>
    </HomeStyled>
  );
};

export default Home;
